        <text 
              x="120"  y="60">
        How many slices?
        </text>
		
		<foreignObject x="380" y="35" width="80" height="100">
			<div>
    <input type="number" id="myInput">
    <button type="button" onclick="slice();">Slice It!</button>	  
	  </input>
          </div>
			</foreignObject>
		
    <circle class="pizza" cx="400" cy="400" r="200" stroke="#f29966" stroke-width="6" 
	style="fill:url(#raylogo);" />
	
		
	<svg width="100" height="100" viewBox="0 0 3 2" x="10" y="5">
		<rect width="3" height="2" fill="#009246"/>
		<rect width="2" height="2" fill="#fff"/>
		<rect width="1" height="2" fill="#ce2b37"/>
	</svg>
	  
</svg>
	

	<script>
	
	var svgNS = "http://www.w3.org/2000/svg";
	var svgRef = document.getElementById("context");
	var sliceONOFFindicator = 0;  
	
	
	function slice() {
	
	var lc = (document.getElementById("myInput").value) - 1;
	
	if((lc > 100) || (lc < 1) ) {
	alert("Can't serve less than 2 or over 101 slices!");
		 document.setElementById("myInput").value = 0;
		 lc = 0;
		 sliceONOFFindicator = 0;
         return;
	}	
	
	if (sliceONOFFindicator == 1) { 
		clearpie();
		sliceONOFFindicator = 0;
		}
	
	if ( lc !=0 ){
	var angle = degr = 360 / (lc+1); }
		
	while (lc >= 0) {
		var line = document.createElementNS(svgNS, "line");
		line.setAttribute("stroke", "#f29966");
		line.setAttribute("stroke-width", 4);
		line.setAttribute("x1", 400);
		line.setAttribute("y1", 400);
		line.setAttribute("x2", 597);
		line.setAttribute("y2", 400);
		line.setAttribute("transform-origin", "center");
		line.setAttribute("transform", "rotate" + "(" + angle + ")");
		svgRef.appendChild(line);
		lc--;
		angle = angle + degr;
		}
		
		sliceONOFFindicator = 1;
	
	}
	
	function clearpie() {
		
		var list = document.querySelectorAll('line');
		var count = list.length;
		for (i = 0; i < count; i++) {
			list[i].remove(); 
			}
	}
	</script>
